import Notes from "./Notes";

export const Home = (props) => {
  const { showAlert, notes } = props;
  return (
    <div className="my-3">
      <h1 className="my-4">Welcome, {notes.name}</h1>
      <Notes showAlert={showAlert} />
    </div>
  );
};
